import React from 'react';
import './Legend.css';  // Assuming you will add custom styles in this CSS file

const Legend = () => {
    const legendItems = [
        { label: 'Recreational', color: '#FF6347' },   // Tomato color
        { label: 'Park', color: '#90EE90' },          // Light green color
        { label: 'School', color: '#4682B4' },        // Steel blue color
        { label: 'Sewage screening plant', color: '#FFD700' }, // Gold color
        { label: 'Car park', color: '#D3D3D3' },      // Light gray color
        { label: 'Developed residential space', color: '#8A2BE2' }, // Blue violet color
        { label: 'Newly developed residential space', color: '#FFA07A' }, // Light salmon color
    ];

    return (
        <div className="legend-container">
            {legendItems.map((item, index) => (
                <div key={index} className="legend-item">
                    <div
                        className="legend-color-box"
                        style={{ backgroundColor: item.color }}
                    ></div>
                    <span className="legend-label">{item.label}</span>
                </div>
            ))}
        </div>
    );
};

export default Legend;
